            <Grid container spacing={3}>
                <Grid item xs={12}>
                    <Typography align="center" variant="h2">About</Typography>
                </Grid>
                <Grid item xs={12} sm={6}>
                    <Typography align="center">
                        Some picture here
                    </Typography>

                </Grid>
                <Grid item xs={12} sm={6}>
                    <Typography align="center">
                        Some text here
                    </Typography>
                </Grid>
            </Grid>
        );
    }
}

export default About;
